   "source": [
    "NAS <- which(is.na(attributes(pred_test_nb)$prob[2, ]))\n",
    "\n",
    "str(length(pred_test_nb))\n",
    "str(pred_test_nb)\n",
    "\n",
    "pred_test_nb_NF = attributes(pred_test_nb)$prob[2, -NAS]\n",
    "true_test_nb_NF = true_test_nb[-NAS]\n",
    "\n",
    "ppred_train <- ROCR::prediction(attributes(pred_train_nb)$prob[2, ], true_train_nb)\n",
    "rroc_train <- ROCR::performance(ppred_train,\"tpr\",\"fpr\")\n",
    "ppred_test <- ROCR::prediction(pred_test_nb_NF, true_test_nb_NF)\n",
    "rroc_test <- ROCR::performance(ppred_test,\"tpr\",\"fpr\")\n",
    "\n",
    "plot(rroc_train, main = \"NB Baseline ROC Curve \\nMLE\", col='blue', label='train')\n",
    "plot(rroc_test, add = TRUE, col='black')\n",
    "abline(a=0, b=1, col = \"red\")\n",
    "\n",
    "#AUC\n",
    "auc <- performance(ppred_test, \"auc\")\n",
    "auc <- unlist(slot(auc,\"y.values\"))\n",
    "auc <- round(auc, 4)\n",
    "\n",
    "legend(\n",
    "    \"bottomright\",\n",
    "    legend=c(\"Train\", \"Test\"),\n",
    "    lty=1,\n",
    "    col=c(\"blue\", \"black\"),\n",
    "    lwd=1\n",
    ")\n",
    "\n",
    "auc"
   ]
