   "source": [
    "folds <- createFolds(data_train$ClaimCountClassification, k = 10)\n",
    "options(warn=-1)\n",
    "\n",
    "alphas = c(5, 10, 50, 100, 500)\n",
    "\n",
    "roc_auc = c()\n",
    "pr_auc = c()\n",
    "\n",
    "for (a in 1:length(alphas)) {\n",
    "    alpha <- alphas[a]\n",
    "    \n",
    "    for (i in 1:length(folds)) {\n",
    "        x <- unlist(folds[i])\n",
    "        d_train <- data_train[-x, ]\n",
    "        d_test <- data_train[x, ]\n",
    "\n",
    "        \n",
    "        fitted <- bn.fit(naive_bayes, d_train, method='bayes', iss=alpha)\n",
    "        pred_values <- predict(fitted, d_test, prob=TRUE, node='ClaimCountClassification')\n",
    "        actual_values <- d_test[, 'ClaimCountClassification']\n",
    "        \n",
    "        \n",
    "        ppred <- prediction(attributes(pred_values)$prob[2, ], actual_values)\n",
    "        current_roc_auc <- performance(ppred, \"auc\")\n",
    "        current_roc_auc <- unlist(slot(current_roc_auc,\"y.values\"))\n",
    "        current_roc_auc <- round(current_roc_auc, 8)\n",
    "        roc_auc <- c(roc_auc, current_roc_auc)\n",
    "        \n",
    "        current_auc_pr <- performance(ppred, 'aucpr')\n",
    "        current_auc_pr <- unlist(slot(current_auc_pr, \"y.values\"))\n",
    "        current_auc_pr <- round(current_auc_pr, 4)\n",
    "        pr_auc <- c(pr_auc, current_auc_pr)\n",
    "        \n",
    "        # str(current_roc_auc)\n",
    "        # str(current_auc_pr)\n",
    "        \n",
    "    }\n",
    "}\n",
    "\n",
    "mean(roc_auc[1:10])\n",
    "sd(roc_auc[1:10])\n",
    "\n",
    "mean(roc_auc[11:20])\n",
    "sd(roc_auc[11:20])\n",
    "\n",
    "mean(roc_auc[21:30])\n",
    "sd(roc_auc[21:30])\n",
    "\n",
    "mean(roc_auc[31:40])\n",
    "sd(roc_auc[41:50])\n",
    "\n",
    "mean(roc_auc[31:40])\n",
    "sd(roc_auc[31:40])\n",
    "\n",
    "\n",
    "mean(pr_auc[1:10])\n",
    "sd(pr_auc[1:10])\n",
    "\n",
    "mean(pr_auc[11:20])\n",
    "sd(pr_auc[11:20])\n",
    "\n",
    "mean(pr_auc[21:30])\n",
    "sd(pr_auc[21:30])\n",
    "\n",
    "mean(pr_auc[31:40])\n",
    "sd(pr_auc[31:40])\n",
    "\n",
    "mean(pr_auc[41:50])\n",
    "sd(pr_auc[41:50])"
   ]
  },
