   "source": [
    "prec_rec <- performance(ppred_test, \"prec\", \"rec\")\n",
    "plot(prec_rec, main = \"NB Baseline PR Curve \\n MLE\", asp = 1)\n",
    "\n",
    "x <- prec_rec@x.values[[1]] # Recall values\n",
    "y <- prec_rec@y.values[[1]] # Precision\n",
    "\n",
    "auc_pr <- performance(ppred_test, 'aucpr')\n",
    "auc_pr <- unlist(slot(auc_pr, \"y.values\"))\n",
    "auc_pr <- round(auc_pr, 4)\n",
    "\n",
    "auc_pr"
   ]
