   "source": [
    "options(repr.plot.width=7, repr.plot.height=7)\n",
    "\n",
    "ppred_train <- ROCR::prediction(attributes(pred_train_hc)$prob[2, ], true_train_hc)\n",
    "rroc_train <- ROCR::performance(ppred_train,\"tpr\",\"fpr\")\n",
    "ppred_test <- ROCR::prediction(attributes(pred_test_hc)$prob[2, ], true_test_hc)\n",
    "rroc_test <- ROCR::performance(ppred_test,\"tpr\",\"fpr\")\n",
    "\n",
    "plot(rroc_train, main = \"HC Baseline ROC Curve \\n Bayes α=10\", col='blue', label='train')\n",
    "plot(rroc_test, add = TRUE, col='black')\n",
    "abline(a=0, b=1, col = \"red\")\n",
    "\n",
    "#AUC\n",
    "auc <- performance(ppred_test, \"auc\")\n",
    "auc <- unlist(slot(auc,\"y.values\"))\n",
    "auc <- round(auc, 4)\n",
    "\n",
    "legend(\n",
