   "source": [
    "ppred <- prediction(attributes(pred_test_hc)$prob[2, ], true_test_hc)\n",
    "ppred\n",
    "\n",
    "rroc <- performance(ppred,\"tpr\",\"fpr\")\n",
    "plot(rroc, main = \"ROC Curve\")\n",
    "abline(a=0, b=1, col = \"red\")\n",
    "\n",
    "#AUC\n",
    "auc <- performance(ppred, \"auc\")\n",
    "auc <- unlist(slot(auc,\"y.values\"))\n",
    "auc <- round(auc, 4)\n",
    "legend(.6,.4,auc, title = \"AUC\")"
   ]
